import React from 'react';
import Body from './Body.js';
import {Switch,Route} from 'react-router-dom';

function Pages() {
    return (
        <Switch>
            <Route path="/"><Body/></Route>
            <Route path="/"></Route>
        </Switch>
    )
}

export default Pages
